  false,\n\t\"url\": null,\n\t\"notes\": \"This report details Greater Sandhill Crane
  colt survival at Ruby lake NWR during the time period from 1984 to 2006. Management
  recommendations are suggested to increase greater sandhill crane colt survival on
  the Refuge. Ruby Lake National Wildlife Refuge (Refuge) is an important nesting
  area for the Lower Colorado River Valley Population of greater sandhill cranes (Grus
  canadensis tabida). Survival of greater sandhill crane colts on the Refuge has been
  poor for many years. From 1984 to 1997 mean sandhill crane production was 0.9 colts
  per year with annual production ranging from 0 to 3 colts fledged per year. From
  1986 through 1993 no known crane colts survived on the Refuge. Radio telemetry was
  used during 1996 and 1997 to investigate causes of mortality of greater sandhill
  crane colts. Five sandhill crane colts fledged while mortality occurred in 20 colts.
  Causes of sandhill crane colt mortality were determined for 11 colts and included
  coyote predation and natural causes. Four additional colts died from unknown causes.
  The highest mortality rates occurred in brood habitat lacking cover. Management
  recommendations are suggested to increase greater sandhill crane colt survival on
  the Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
